import React from 'react';
import styles from './NationCard.module.scss';

export const NationCard = () => {
  const tabContArr = [
    {
      index: 0,
      tabTitle: "여행지명0",
      tabCont: "여행지상세0"
    },
    {
      index: 1,
      tabTitle: "여행지명1",
      tabCont: "여행지상세1"
    },
    // {
    //   index: 2,
    //   tabTitle: "여행지명2",
    //   tabCont: "여행지상세2"
    // },
    // {
    //   index: 3,
    //   tabTitle: "여행지명3",
    //   tabCont: "여행지상세3"
    // }
  ];

  return (
    <div className={styles.NationCardWrapper}>
      <div className={styles.NationCardContainer}>
        {tabContArr.map((section) => (
          <div key={section.index} className={styles.CardContainer}>
            <div className={styles.TabContentImage}></div>
            <p className={styles.TabTitle}>{section.tabTitle}</p>
            <div className={styles.TabContentItem}>
              {typeof section.tabCont === 'string' ? (
                <span className={styles.TabContentDetail}>
                  {section.tabCont}
                </span>
              ) : (
                section.tabCont.map((item, idx) => (
                  <span key={idx} className={styles.TabContentDetail}>
                    {item}
                  </span>
                ))
              )}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};
